  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Charles
  M. Russell NWR (including the satellite refuges) outlines Refuge accomplishments
  during the 1983 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan, management plan, public participation,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, and safety is given.
  Habitat management is also covered; subjects include wetlands, croplands, grasslands,
  grazing, haying, fire management, pest control, and wilderness and special areas.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory birds,
  game mammals, other resident wildlife, fisheries resources, wildlife propagation
  and stocking, surplus animal disposal, animal control, marking and bird banding,
  and disease prevention and control. The public uses of the Refuge described in this
  report include interpretive programs, hunting, fishing, off-road vehicles, and law
  enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, and equipment utilization
  and replacement. Items of interest are provided at the end. Brief narratives on
  Hailstone, Halfbreed, Lake Mason, and War Horse National Wildlife Refuges are attached.
  Reports for Tew and Spidel Waterfowl Production Area are also included.\",\n\t\"license_title\":
